import React, { ReactElement } from 'react';
import { QuoteType } from './types';

type QuoteCardPropType = {
    quote: QuoteType;
};
const QuoteCard = (props: QuoteCardPropType): ReactElement => {
    const { quote } = props;

    return (
        <div className="min-w-sm max-w-sm min-h-md bg-gray-100 shadow-sm rounded-lg p-4 m-4">
            {/* <h1 className="text-md font-s mb-2">{quote.quote}</h1> */}

            <p>{quote.quote}</p>
            <h3 className="font-medium text-sm text-right text-teal-500  w-full .content-end capitalize tracking-min">
                {quote.author}
            </h3>
        </div>
    );
};

export default QuoteCard;
